// src/components/ResultsDisplay.js
import React from 'react';
import { Card, Row, Col, Table, Image, Alert } from 'react-bootstrap'; // Importar Image y Alert

/**
 * Componente para mostrar los resultados del análisis, incluyendo gráficos.
 * @param {object} props
 * @param {object} props.data - El objeto completo devuelto por /api/analyze (contiene 'results' y 'plots').
 */
const ResultsDisplay = ({ data }) => {
  // Extraer resultados y plots del objeto 'data' de forma segura
  const results = data?.results;
  const plots = data?.plots;

  // Mensaje si no hay datos de resultados
  if (!results) {
    return (
        <Card className="results-card mt-4">
            <Card.Body>
                <Card.Title>Analysis Results</Card.Title>
                <p className="text-muted">No analysis results available yet or analysis failed.</p>
            </Card.Body>
        </Card>
    );
  }

  // Función auxiliar para formatear valores en la tabla
  const formatValue = (value) => {
    if (value === null || typeof value === 'undefined') return 'N/A';
    if (typeof value === 'number') {
      // Formatear floats con precisión razonable
      if (value % 1 !== 0) { return value.toFixed(4); }
      return value; // Entero
    }
    if (typeof value === 'boolean') { return value ? 'Yes' : 'No'; }
    // Acortar strings muy largos
    const strValue = String(value);
    if (strValue.length > 150) { return strValue.substring(0, 147) + '...'; }
    return strValue;
  };

  // Obtener columnas para la tabla (asegurándose de que haya registros)
  const anomalyColumns = results.sample_anomalous_records?.length > 0
    ? Object.keys(results.sample_anomalous_records[0])
    : [];

  return (
    <Card className="results-card mt-4"> {/* Añadir margen superior */}
      <Card.Body>
        <Card.Title>Analysis Results</Card.Title>

        {/* Resumen Numérico */}
        <Alert variant="info" className="results-summary mb-4">
          <Row>
            <Col md={4} className="mb-2 mb-md-0">
                <strong>Records Analyzed:</strong> {results.total_records_analyzed ?? 'N/A'}
            </Col>
            <Col md={4} className="mb-2 mb-md-0">
                <strong>Anomalies Found:</strong> {results.detected_anomalies_count ?? 'N/A'} ({results.detected_anomalies_percentage ?? 'N/A'}%)
            </Col>
            <Col md={4} className="mb-2 mb-md-0">
                 <strong>Threshold (MSE):</strong> {(results.anomaly_threshold ?? 0).toExponential(4)} {/* Notación exponencial */}
            </Col>
          </Row>
           <Row className="mt-2">
              <Col>
                  <strong>Columns Used:</strong> <small>{results.columns_analyzed?.join(', ') ?? 'N/A'}</small>
              </Col>
           </Row>
           {/* Opcional: Mostrar features internas si es útil
           <Row className="mt-1">
              <Col>
                  <strong>Model Features:</strong> <small>{results.features_used_in_model?.join(', ') ?? 'N/A'}</small>
              </Col>
           </Row> */}
        </Alert>

        {/* Gráficos (Mostrar lado a lado si hay ambos) */}
        {plots && (plots.mse_histogram || plots.loss_curve) && (
          <div className="plots-container mb-4">
            <h5>Model Insights</h5>
            <Row>
              {plots.mse_histogram && (
                <Col md={6} className="mb-3 text-center">
                  <h6>Reconstruction Error (MSE) Distribution</h6>
                  {/* Imagen base64 */}
                  <Image src={`data:image/png;base64,${plots.mse_histogram}`} fluid thumbnail alt="MSE Histogram" />
                </Col>
              )}
              {plots.loss_curve && (
                <Col md={6} className="mb-3 text-center">
                  <h6>Model Training Loss</h6>
                  <Image src={`data:image/png;base64,${plots.loss_curve}`} fluid thumbnail alt="Loss Curve" />
                </Col>
              )}
            </Row>
          </div>
        )}

        {/* Tabla de Registros Anómalos */}
        <div className="anomaly-records mt-4">
          <h6>Sample Anomalous Records (Top 10 by Anomaly Score)</h6>
          {results.sample_anomalous_records && results.sample_anomalous_records.length > 0 ? (
            <div className="table-responsive"> {/* Permite scroll horizontal si la tabla es ancha */}
              <Table striped bordered hover responsive size="sm"> {/* responsive añade scroll horizontal en pantallas pequeñas */}
                <thead>
                  <tr>
                    {/* Crear encabezados basados en las claves del primer registro */}
                    {anomalyColumns.map((key) => (
                      <th key={key}>{key.replace(/_/g, ' ').replace(/\b\w/g, l => l.toUpperCase())}</th> // Formatear títulos
                    ))}
                  </tr>
                </thead>
                <tbody>
                  {/* Crear filas iterando sobre los registros */}
                  {results.sample_anomalous_records.map((record, index) => (
                    <tr key={record.original_index ?? index}> {/* Usar índice original si existe */}
                      {/* Crear celdas iterando sobre las claves (mantiene orden) */}
                      {anomalyColumns.map((key) => (
                        <td key={`${record.original_index ?? index}-${key}`}>
                           {formatValue(record[key])} {/* Usar función de formato */}
                        </td>
                      ))}
                    </tr>
                  ))}
                </tbody>
              </Table>
            </div>
          ) : (
            // Mensaje si no se encontraron anomalías
            <p className="text-muted fst-italic mt-3">No anomalous records found with the current settings and threshold.</p>
          )}
        </div>

      </Card.Body>
    </Card>
  );
};

export default ResultsDisplay;
